',NULL),('FSC51','FSEC_CHECKLIST',51,'Provide efficient communication system for warning occupants and calling fire department. ','WARNING SYSTEMS',NULL),('FSC52','FSEC_CHECKLIST',52,'Provide approved type portable fire extinguisher (dry chemical) ABC type, {0} lbs. capacity for every 200 sq.m of floor area(low hazard), 100 sq. m floor area(moderate hazard) and 75 sq. m floor area(high hazard) areas or 22.8 m (75 ft) travel distance on every floor level. ','FIRE PROTECTION ','d'),('FSC53','FSEC_CHECKLIST',53,'Provide {0} with {1} mm riser and coupling of fire department standards with pumps of reliable pressure & connected to an adequate water supply tank. Hose and hose cabinet shall be provided at every hose gate valve on all floors. ','FIRE PROTECTION ','s,d'),('FSC54','FSEC_CHECKLIST',54,'Provide Fire Service connection with a standard outlet of 64 mm, and 102 mm dry standpipe, and shall located on a street front. ','FIRE PROTECTION ',NULL),('FSC55','FSEC_CHECKLIST',55,'Provide automatic fire extinguishing system where kitchen equipment is located (Kitchenhood). ','FIRE PROTECTION ',NULL),('FSC56','FSEC_CHECKLIST',56,'Provide automatic chemical extinguishing system on all areas where electronic/electrical equipment are located. ','FIRE PROTECTION ',NULL),('FSC57','FSEC_CHECKLIST',57,'Provide approved-type automatic fire extinguishing system in accordance with NFPA 13.  Approval of system plan is required prior to installation ','FIRE PROTECTION ',NULL),('FSC58','FSEC_CHECKLIST',58,'Provide outside window opening on bedrooms with a clear opening of not less than fifty six (56) cm in least dimension and forty five-hundredths (0.45) m2 in area. The bottom of the window shall be not more than one hundred twenty two (122) cm above the floor. ','MISCELLANEOUS ',NULL),('FSC59','FSEC_CHECKLIST',59,'All liquefied petroleum gas equipment including such equipment installed at utility gas plants shall be installed in accordance with the provisions of NFPA 59. ','MISCELLANEOUS ',NULL),('FSC60','FSEC_CHECKLIST',60,'No grills or any obstruction shall be installed on window openings and/or fire exits. ','MISCELLANEOUS ',NULL),('FSC61','FSEC_CHECKLIST',61,'Provide emergency lighting facilities with automatic transfer switch to AC/DC power source. ','MISCELLANEOUS ',NULL),('FSC62','FSEC_CHECKLIST',62,'Air conditioning ducts must be provided with approved fire dampers. ','MISCELLANEOUS ',NULL),('FSC63','FSEC_CHECKLIST',63,'Roof covering must be of non-combustible materials. Combustible roof covering must have fire retardant treatment. ','MISCELLANEOUS ',NULL),('FSC64','FSEC_CHECKLIST',64,'Provide fire escape ladder.','MISCELLANEOUS ',NULL),('FSC65','FSEC_CHECKLIST',65,'Provide fire escape stair. ','MISCELLANEOUS ',NULL),('FSC66','FSEC_CHECKLIST',66,'All unit partition wall shall be extended up to upper floor slab and/or one (1) meter above the roofline. ','MISCELLANEOUS ',NULL),('FSC67','FSEC_CHECKLIST',67,'Provide effective means of smoke ventilation such as access panels, movable windows. ','MISCELLANEOUS ',NULL),('FSC68','FSEC_CHECKLIST',68,'Project activity shall not affect the effectivity of the existing fire protection facilities. ','MISCELLANEOUS ',NULL),('FSC69','FSEC_CHECKLIST',69,'Provide/post allowable occupant load sign/s. Such signs shall be conspicuously and suitably located. ','MISCELLANEOUS ',NULL),('FSC70','FSEC_CHECKLIST',70,'Provide fire protection/suppression during construction. ','MISCELLANEOUS ',NULL),('FSC71','FSEC_CHECKLIST',71,'Provide fire exit plan for each floor of the building showing the routes from each room to appropriate exits, displayed prominently on the door of each room. ','MISCELLANEOUS ',NULL),('FSC72','FSEC_CHECKLIST',72,'No heating or lighting apparatus or equipment capable of igniting flammable materials shall be used in any storage or work area where rags, excelsior, hair or other highly flammable or combustible materials are stored or used. ','MISCELLANEOUS ',NULL),('FSC73','FSEC_CHECKLIST',73,'Provide/post \"NO SMOKING\" sign/s where combustible materials are stored or handled. Such signs shall be conspicuously and suitable located. ','MISCELLANEOUS ',NULL),('FSC74','FSEC_CHECKLIST',74,'If high hazard commodities will be stored/handled, automatic fire suppression system shall be provided.','MISCELLANEOUS ',NULL),('FSC75','FSEC_CHECKLIST',75,'Provide/post \"DO NOT USE ELEVATOR IN CASE OF FIRE\" sign/s. ','MISCELLANEOUS ',NULL),('FSC76','FSEC_CHECKLIST',76,'LPG tank/s must be installed outside the building and should be provided with safety devices that automatically stop the flow of gas should a leak develop. ','MISCELLANEOUS ',NULL),('FSC77','FSEC_CHECKLIST',77,'Provide fire resistive walls between stair & kitchen area. ','MISCELLANEOUS ',NULL),('FSC78','FSEC_CHECKLIST',78,'Provide outside window/s for rescue and ventilation with a minimum clear opening of 55 cm and approximately one half (0.5) m2 in area; the bottom of window opening is not more than eighty two (82) cm above the floor; it can readily be opened from the inside without the use of tools; where storm windows, screens, or antiburglar devices are used, these be provided with quick mechanism so that they may be so arranged that when opened they will not drop to the ground. ','MISCELLANEOUS ',NULL),('FSC79','FSEC_CHECKLIST',79,'Rooms used for kindergarten, first or second grade pupils shall not be located above or below the floor of exit discharge. Rooms used for second grade pupils shall not be located more than one (1) storey above the floor of exit discharge. ','MISCELLANEOUS ',NULL),('FSC80','FSEC_CHECKLIST',80,'Provide firefighters elevator. ','MISCELLANEOUS ',NULL),('FSC81','FSEC_CHECKLIST',81,'All correction indicated on the original approved plan from this office on {0} shall be followed. ','MISCELLANEOUS ','s'),('FSC82','FSEC_CHECKLIST',82,'Any changes in occupancy other than stated shall be in accordance with Rule 10.  ','MISCELLANEOUS ',NULL),('FSC83','FSEC_CHECKLIST',83,'Subject to inspection during construction.  ','MISCELLANEOUS ',NULL),('FSC84','FSEC_CHECKLIST',84,'Fire Safety Inspection Certificate must be secured before/prior to issuance of Certificate of Occupancy. ','MISCELLANEOUS ',NULL),('FSC85','FSEC_CHECKLIST',85,'Subject to additional requirements upon recommendation of the Fire Safety Inspector during construction phase and final inspection. ','MISCELLANEOUS ',NULL),('hw01','HOT_WORKS',1,'Available sprinklers, hose streams and extinguishers in service/operable','GENERAL',NULL),('hw02','HOT_WORKS',2,'Hot work equipment in good repair','GENERAL',NULL),('hw03','HOT_WORKS',3,'Flammable liquids, dust, lint and all deposits removed','REQUIREMENT WITHIN 35FT (10M) OF WORK',NULL),('hw04','HOT_WORKS',4,'Explosive atmosphere in area eliminated','REQUIREMENT WITHIN 35FT (10M) OF WORK',NULL),('hw05','HOT_WORKS',5,'Floors swept clean','REQUIREMENT WITHIN 35FT (10M) OF WORK',NULL),('hw06','HOT_WORKS',6,'Combustible floors wet down, covered with damp sand or fire resistant sheets','REQUIREMENT WITHIN 35FT (10M) OF WORK',NULL),('hw07','HOT_WORKS',7,'Remove other combustibles where possible, otherwise protect with fire resistant tarpaulins or metal shields','REQUIREMENT WITHIN 35FT (10M) OF WORK',NULL),('hw08','HOT_WORKS',8,'All wall and floor openings covered','REQUIREMENT WITHIN 35FT (10M) OF WORK',NULL),('hw09','HOT_WORKS',9,'Fire resistant tarpaulins suspended beneath work','REQUIREMENT WITHIN 35FT (10M) OF WORK',NULL),('hw10','HOT_WORKS',10,'Construction is non-combustible and without combustible covering insulation','WORK ON WALLS OR CEILINGS/ENCLOSED EQUIPMENT',NULL),('hw11','HOT_WORKS',11,'Combustible on other side walls moved away','WORK ON WALLS OR CEILINGS/ENCLOSED EQUIPMENT',NULL),('hw12','HOT_WORKS',12,'Danger exist by conduction of heat into another area','WORK ON WALLS OR CEILINGS/ENCLOSED EQUIPMENT',NULL),('hw13','HOT_WORKS',13,'Enclosed equipment cleaned of all combustibles','WORK ON WALLS OR CEILINGS/ENCLOSED EQUIPMENT',NULL),('hw14'