INSERT INTO `sys_email_template` VALUES ('building_finding_transmittal','Findings for App no ${appno}','Dear ${contact.name}, <br>\n\nWe have checked through your evaluation and it seems you have deficiencies in your design.  \n\nAccomplish them and send them back to the OBO Office. <br>\n\nRegards, <br>\n\nThe Legazpi OBO Team'),('building_permit','Building Permit ${controlno}','Dear valued client,\n\nPlease review the documents sent. \n\n\nSincerely,\n\nOBO Legazpi team\n\n'),('building_permit_assessment','Order of Payment for Building Permit App No ${appno}','Dear ${contact.name}, <br>\n<br>\nThis has reference to your application for Building Permit with our office. <br>\n<br>\nRelative thereto, attached is a copy of the Order of Payment for said application. Kindly pay the necessary fees, through our cashier or online payment in the City\'s website, for us to continue with the processing and approval of your application. <br>\n<br>\nThank you. <br>\n<br>\n<br>\nOBO Legazpi City'),('building_permit_claimstub','Building Application Claim Stub for ${appno}','Dear ${contact.name}, <br>\n\nCongratulations! Your application was accepted. We will now proceed with the evaluation process. \nFor reference your application number is \n\n<h2>${appno}</h2>\n\nPlease use this number to follow up on the progress of your application. To check on the progress of your application\nplease visit the ff <a href=\"https://www.filipizen.com/partners/albay_legazpi/services/obo/monitorbuildingpermit?appno=${appno}\">link</a>\n <br>\n\nRegards, <br>\n\nThe Legazpi OBO Team'),('building_requirement_transmittal','Requirements for ${trackingno}','Dear ${contact.name}, <br>\n\nWe have checked through your requirements and it seems you have deficiencies in the sent requirements. Please see \nattached for the details. \n\nAccomplish them and send them back to the OBO Office. <br>\n\nRegards, <br>\n\nThe Legazpi OBO Team'),('occupancy_requirement_transmittal',NULL,'Dear ${entity.contact.name}, <br>\n\nWe have checked through your requirements and it seems you have deficiencies in the sent requirements. Please see \nattached for the details. \n\nAccomplish them and send them back to the OBO Office. <br>\n\nRegards, <br>\n\nThe Legazpi OBO Team');
