INSERT INTO `sys_rule_deployed` VALUES ('RUL-108b4192:15b3d234d5c:-67b1','\npackage oboassessment.ADD_PLUMBING_FEE;\nimport oboassessment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"ADD_PLUMBING_FEE\"\n	agenda-group \"initial\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		BD: obo.facts.BuildingSubdoc (  doctype matches \"PLUMBING\" ) \n		\n	then\n		Map bindings = new HashMap();\n		\n		bindings.put(\"BD\", BD );\n		\n	Map _p0 = new HashMap();\n_p0.put( \"amount\", (new ActionExpression(\"0\", bindings)) );\n_p0.put( \"billcode\", new KeyValue(\"PLUMBING_FEE\", \"PLUMBING FEE\") );\naction.execute( \"add-billitem\",_p0,drools);\n\nend\n\n\n	'),('RUL-108b4192:15b3d234d5c:-6ad6','\npackage oboassessment.MECHANICAL_FEE_PNEUMATIC_TUBES_LNM;\nimport oboassessment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"MECHANICAL_FEE_PNEUMATIC_TUBES_LNM\"\n	agenda-group \"compute-mechanical-fee\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		BILLITEM: treasury.facts.BillItem (  billcode matches \"MECHANICAL_FEE\" ) \n		\n		 obo.facts.OboDecimalInfo (  name matches \"PNEUMATIC_TUBE_CONVEYOR_MONORAIL\",LNM:value ) \n		\n	then\n		Map bindings = new HashMap();\n		\n		bindings.put(\"BILLITEM\", BILLITEM );\n		\n		bindings.put(\"LNM\", LNM );\n		\n	Map _p0 = new HashMap();\n_p0.put( \"billitem\", BILLITEM );\n_p0.put( \"type\", \"ADD\" );\n_p0.put( \"amount\", (new ActionExpression(\"Math.ceil( LNM ) * 10\", bindings)) );\naction.execute( \"update-billitem-amount\",_p0,drools);\n\nend\n\n\n	'),('RUL-108b4192:15b3d234d5c:-6c55','\npackage oboassessment.MECHANICAL_FEE_OTHER_MACHINERY_EQUIPMENT;\nimport oboassessment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"MECHANICAL_FEE_OTHER_MACHINERY_EQUIPMENT\"\n	agenda-group \"compute-mechanical-fee\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		BILLITEM: treasury.facts.BillItem (  billcode 